import{_ as e,c as a,o as p,d as r}from"./app.c4f45da1.js";const b=JSON.parse('{"title":"\u6700\u7EC8\u7AE0   - \u65C5\u7A0B\u7684\u7EC8\u70B9","description":"","frontmatter":{},"headers":[{"level":2,"title":"\u7EC8\u7AE0","slug":"\u7EC8\u7AE0","link":"#\u7EC8\u7AE0","children":[]},{"level":2,"title":"\u8C22\u5E55","slug":"\u8C22\u5E55","link":"#\u8C22\u5E55","children":[]}],"relativePath":"Node.js/\u57FA\u4E8E Node \u7684 DevOps \u5B9E\u6218/\u6700\u7EC8\u7AE0-\u65C5\u7A0B\u7684\u7EC8\u70B9.md"}'),t={name:"Node.js/\u57FA\u4E8E Node \u7684 DevOps \u5B9E\u6218/\u6700\u7EC8\u7AE0-\u65C5\u7A0B\u7684\u7EC8\u70B9.md"},d=r('<h1 id="\u6700\u7EC8\u7AE0-\u65C5\u7A0B\u7684\u7EC8\u70B9" tabindex="-1">\u6700\u7EC8\u7AE0 - \u65C5\u7A0B\u7684\u7EC8\u70B9 <a class="header-anchor" href="#\u6700\u7EC8\u7AE0-\u65C5\u7A0B\u7684\u7EC8\u70B9" aria-hidden="true">#</a></h1><hr><h2 id="\u7EC8\u7AE0" tabindex="-1">\u7EC8\u7AE0 <a class="header-anchor" href="#\u7EC8\u7AE0" aria-hidden="true">#</a></h2><p>\u7EC8\u4E8E\u8D70\u5230\u4E86\u6700\u7EC8\u7AE0\u8282\uFF0C\u8FD9\u4E00\u8DEF\u4E0B\u6765\uFF0C\u60F3\u5FC5\u4E5F\u662F\u5C0F\u518C\u5386\u53F2\u4E2D\u6700\u957F\u7684\u8FDE\u8F7D\u4E86\u3002</p><p>\u4E0D\u77E5\u9053\u5927\u5BB6\u6709\u6CA1\u6709\u5370\u8C61\uFF0C\u5728\u670D\u52A1\u7AEF\u5B8C\u7ED3\u4E4B\u540E\uFF0C\u6211\u4EEC\u4E00\u76F4\u5728\u90FD\u6CA1\u6709\u518D\u66F4\u65B0 devops node \u6A21\u5757\u7684\u4EE3\u7801\uFF0C\u8FD9\u662F\u56E0\u4E3A\u540E\u7EED\u7684\u6A21\u5757\u5176\u5B9E\u8DDF\u5355\u7EAF\u7684 devops \u7684\u5185\u5BB9\u4E0D\u592A\u76F8\u5173\u4E86\uFF0C\u8FD9\u4E9B\u6A21\u5757\u7684\u6709\u4E0E\u6CA1\u6709\u5E76\u6CA1\u6709\u592A\u591A\u7684\u5F71\u54CD\u6211\u4EEC\u7684 CICD \u7684\u4E3B\u6D41\u7A0B\uFF0C\u53EA\u662F\u8D77\u5230\u4E86\u9526\u4E0A\u6DFB\u82B1\u7684\u4F5C\u7528\uFF0C\u6240\u4EE5\u5176\u5B9E\u8FD9\u672C\u5C0F\u518C\u6309\u6807\u9898\u7684\u7406\u89E3\u6765\u8BF4\u5E94\u8BE5\u662F\u5728\u5BA2\u6237\u7AEF\u4E4B\u540E\u5C31\u53EF\u4EE5\u5B8C\u7ED3\u4E86\u3002</p><p>\u800C\u8FD9\u672C\u5C0F\u518C\u6700\u521D\u7684\u8BBE\u8BA1\u4E5F\u662F\u57FA\u4E8E\u6211\u4E4B\u524D\u7684\u4E00\u4E2A devops \u7CFB\u5217\u6587\u7AE0\u884D\u751F\u51FA\u6765\u7684\uFF0C\u6700\u5F00\u59CB\u5199\u7684\u65F6\u5019\u4E5F\u662F\u60F3\u5728\u5BA2\u6237\u7AEF\u5B8C\u7ED3\u5C31\u622A\u7A3F\u4E86\uFF0C\u8D81\u7740\u8282\u65E5\u4E5F\u8DDF\u5927\u5BB6\u804A\u804A\u5199\u4F5C\u8FC7\u7A0B\u7684\u60F3\u6CD5\uFF1A</p><h4 id="\u6700\u521D\u7684\u987E\u8651" tabindex="-1">\u6700\u521D\u7684\u987E\u8651 <a class="header-anchor" href="#\u6700\u521D\u7684\u987E\u8651" aria-hidden="true">#</a></h4><p>\u7B2C\u4E00\u4E2A\u95EE\u9898\u662F\u53D7\u4F17\uFF0C\u524D\u7AEF\u5728 devops \u7684\u6DF1\u5165\u5BF9\u524D\u7AEF\u53D1\u5C55\u7684\u4EF7\u503C\u4E0D\u7B97\u5927\uFF0C\u672F\u4E1A\u6709\u4E13\u653B\uFF0C\u8FD9\u4E5F\u662F\u6211\u8FD9\u4E9B\u5E74\u5DE5\u4F5C\u4E2D\u6DF1\u6709\u4F53\u4F1A\uFF0C\u6BD5\u7ADF\u5728\u8FD9\u4E48\u591A\u5C0F\u516C\u53F8\u90FD\u5DE5\u4F5C\u8FC7\uFF0C\u5BFC\u81F4\u6211\u7684\u4E13\u4E1A\u6280\u80FD\u5E76\u4E0D\u6DF1\u5165\uFF0C\u66F4\u591A\u7684\u662F\u5E7F\u800C\u4E0D\u7CBE\u901A\u3002</p><p>\u516C\u53F8\u7F3A\u4EC0\u4E48\u3001\u9879\u76EE\u7F3A\u4EC0\u4E48\u3001\u56E2\u961F\u7F3A\u4EC0\u4E48\uFF0C\u6211\u5C31\u5FC5\u987B\u8D76\u7740\u4E0A\uFF0C\u76F8\u4FE1\u5927\u90E8\u5206\u7684\u540C\u5B66\u90FD\u6709\u7C7B\u4F3C\u7684\u60C5\u51B5\u3002\u6240\u4EE5\u6211\u5E76\u4E0D\u5EFA\u8BAE\u524D\u7AEF\u7684\u540C\u5B66\u5F88\u6DF1\u5165\u4E86\u89E3\u8FD9\u5757\u5185\u5BB9\uFF0C</p><p>\u7B2C\u4E8C\u4E2A\u95EE\u9898\u662F\u7EC6\u8282\uFF0C\u6D89\u53CA\u7684\u5185\u5BB9\u8D8A\u591A\u5C31\u8D8A\u96BE\u5C06\u67D0\u4E00\u4E2A\u9886\u57DF\u8BB2\u7684\u7279\u522B\u7EC6\u8282\u4E0E\u6DF1\u5165\uFF0C\u6BD4\u5982 Jenkins \u7684\u811A\u672C\u4F18\u5316\uFF0C\u5176\u5B9E\u8FD8\u6709\u5F88\u591A\u5185\u5BB9\u53EF\u4EE5\u5EF6\u4F38\uFF0CKubernetes \u8FD9\u5757\u5185\u5BB9\u4E5F\u6709\u5F88\u591A\u7684\u5730\u65B9\u53EF\u4EE5\u7EE7\u7EED\u8BB2\u8FF0\uFF0C\u6BD4\u8F83\u597D\u7684\u5217\u5B50\u662F\u5723\u677E\u7684 CICD \u5C0F\u518C\uFF0C\u4E13\u6CE8\u4E8E\u8FD9\u4E00\u5757\u7684\u5185\u5BB9\uFF0C\u5C31\u4F1A\u975E\u5E38\u7684\u7EC6\u81F4\u3002</p><p>\u7B2C\u4E09\u4E2A\u95EE\u9898\u662F\u65F6\u95F4\uFF0C\u4E00\u65E6\u6D89\u53CA\u5230\u7684\u5185\u5BB9\u975E\u5E38\u7684\u5E7F\uFF0C\u90A3\u4E48\u4E5F\u610F\u5473\u7740\u6211\u9700\u8981\u8DD1\u5B8C\u6240\u6709\u7684\u5185\u5BB9\uFF0C\u81F3\u5C11\u6211\u81EA\u5DF1\u80FD\u591F\u5B8C\u6210\u57FA\u672C\u7684\u6D4B\u8BD5\u624D\u80FD\u63D0\u4F9B\u7ED9\u5927\u5BB6\uFF0C\u9664\u4E86\u81EA\u5DF1\u80FD\u591F\u5B66\u4F1A\u4E4B\u5916\uFF0C\u8FD8\u9700\u8981\u5C06\u81EA\u5DF1\u5B66\u4E60\u8FC7\u7A0B\u7684\u5FC3\u5F97\u3001\u9047\u5230\u7684\u7591\u96BE\u6742\u75C7\u8F6C\u6362\u6210\u80FD\u901A\u4FD7\u6613\u61C2\u7684\u6587\u6848\u5C55\u793A\u7ED9\u5927\u5BB6\uFF0C\u8FD9\u4E2A\u8FC7\u7A0B\u4E5F\u662F\u975E\u5E38\u6D88\u8017\u7CBE\u529B\u7684\u3002</p><p>\u7B2C\u56DB\u4E2A\u95EE\u9898\u662F\u5B66\u4E60\u6210\u672C\uFF0C\u8DDF\u7B2C\u4E00\u4E2A\u95EE\u9898\u7C7B\u4F3C\uFF0C\u6DB5\u76D6\u7684\u5185\u5BB9\u975E\u5E38\u591A\u7684\u8BDD\uFF0C\u90A3\u4E48\u5BF9\u5E94\u7684\u5B66\u4E60\u6210\u672C\u4E5F\u5C31\u500D\u589E\uFF0C\u6574\u4E2A\u5C0F\u518C\u6D89\u53CA\u7684\u4E0D\u4EC5\u4EC5\u662F\u524D\u7AEF\u4E0E\u540E\u7AEF\uFF0C\u8FD8\u5305\u62EC\u6D4B\u8BD5\u3001\u8FD0\u7EF4\u751A\u81F3\u4EA7\u54C1\u601D\u7EF4\u7684\u5185\u5BB9\uFF0C\u6240\u4EE5\u771F\u7684\u4E00\u5957\u5168\u90E8\u8D70\u4E0B\u6765\u7684\u540C\u5B66\uFF0C\u5B66\u4E60\u7684\u5E94\u8BE5\u4E5F\u6BD4\u8F83\u5FC3\u7D2F\uFF0C\u800C\u4E14\u5C0F\u518C\u7684\u5185\u5BB9\u8D77\u5230\u7684\u53EA\u662F\u4E00\u4E2A\u5F15\u5BFC\uFF0C\u66F4\u591A\u7684\u7EC6\u8282\u5982\u679C\u9700\u8981\u94BB\u7814\u7684\u8BDD\uFF0C\u90A3\u8017\u8D39\u7684\u5FC3\u795E\u500D\u589E\u3002</p><p>\u7B2C\u4E94\u4E2A\u95EE\u9898\u662F\u4E2A\u4EBA\u538B\u529B\uFF0C\u81EA\u5DF1\u672C\u8EAB\u4E5F\u662F\u4E00\u4E2A\u5C0F\u524D\u7AEF\uFF0C\u524D\u9762\u4E5F\u63D0\u8FC7\uFF0C\u5F88\u591A\u5185\u5BB9\u5BF9\u6211\u6765\u8BF4\u53EF\u80FD\u4E5F\u53EA\u662F\u4E00\u4E2A\u4F7F\u7528\u8FC7\u3001\u4E86\u89E3\u8FC7\u4F46\u5E76\u672A\u5F88\u6DF1\u5165\u7684\u9886\u57DF\uFF0C\u5982\u679C\u5199\u7684\u4E0D\u597D\u6216\u8005\u4E0D\u80FD\u7ED9\u5404\u4F4D\u540C\u5B66\u5E26\u6765\u4E00\u4E9B\u4EF7\u503C\u7684\u8BDD\uFF0C\u5BF9\u6211\u6765\u8BF4\uFF0C\u5176\u5B9E\u4E5F\u662F\u5F88\u5931\u8D25\u7684\uFF0C\u6240\u4EE5\u6574\u4E2A\u5C0F\u518C\u7684\u5185\u5BB9\uFF0C\u4E0D\u6562\u8BF4\u5199\u7684\u975E\u5E38\u597D\uFF0C\u4F46\u662F\u4E00\u5B9A\u662F\u5F88\u7528\u5FC3\uFF0C\u6240\u6709\u6D89\u53CA\u7684\u9886\u57DF\u4E0E\u6280\u672F\uFF0C\u57FA\u672C\u90FD\u662F\u5F7B\u5E95\u8D70\u8FC7\u4E00\u904D\u6D41\u7A0B\u518D\u8F93\u51FA\u6765\u7684\uFF0C\u5982\u679C\u6211\u81EA\u5DF1\u90FD\u6A21\u68F1\u4E24\u53EF\uFF0C\u90A3\u4E48\u770B\u8FD9\u672C\u5C0F\u518C\u7684\u540C\u5B66\u4E00\u5B9A\u4E5F\u662F\u4E00\u5934\u96FE\u6C34\u3002</p><h4 id="\u4E2D\u95F4\u7684\u5386\u7A0B" tabindex="-1">\u4E2D\u95F4\u7684\u5386\u7A0B <a class="header-anchor" href="#\u4E2D\u95F4\u7684\u5386\u7A0B" aria-hidden="true">#</a></h4><p>\u90A3\u4E48\u4E3A\u4EC0\u4E48\u6709\u4E0A\u8FF0\u8FD9\u4E48\u591A\u7684\u987E\u8651\uFF0C\u6700\u540E\u8FD8\u662F\u9009\u62E9\u5C06\u8FD9\u672C\u5C0F\u518C\u7684\u5185\u5BB9\u6269\u5145\u5230\u8FD9\u4E48\u591A\u5462\uFF1F</p><p>\u5C31\u5982\u540C\u5C0F\u518C\u6700\u5F00\u59CB\u8BF4\u7684\uFF0C\u5C0F\u518C\u7684\u8BFB\u8005\u5F88\u591A\u5E94\u8BE5\u662F\u4E2D\u5C0F\u56E2\u961F\u7684\u540C\u5B66\uFF0C\u5E76\u6CA1\u6709\u5B8C\u6574\u7684\u5DE5\u7A0B\u5316\u6982\u5FF5\uFF0C\u4E5F\u53EF\u80FD\u6CA1\u6709\u5F88\u591A\u7684\u673A\u4F1A\u53BB\u5B9E\u8DF5\uFF0C\u4E0D\u6562\u8BF4\u6211\u5199\u7684\u8FD9\u5957\u5DE5\u7A0B\u5316\u7684\u6982\u5FF5\u76F8\u5BF9\u4E8E\u5176\u4ED6\u7684\u56E2\u961F\u4E00\u5B9A\u597D\uFF0C\u4F46\u6DB5\u76D6\u7684\u5185\u5BB9\u5E94\u8BE5\u662F\u975E\u5E38\u5B8C\u5907\u7684\u3002</p><p>\u90A3\u4E48\u4E70\u5230\u8FD9\u4E2A\u5C0F\u518C\u7684\u524D\u7AEF\u540C\u5B66\uFF0C\u53EF\u4EE5\u5BF9\u6574\u4E2A devops \u6216\u8005\u5DE5\u7A0B\u5316\u7684\u4F53\u7CFB\u6709\u4E00\u4E2A\u5927\u4F53\u7684\u4E86\u89E3\uFF0C\u7136\u540E\u518D\u6311\u9009\u524D\u7AEF\u7684\u67D0\u4E2A\u9886\u57DF\uFF0C\u4F8B\u5982 Node \u5F00\u53D1\u3001 CLI\u3001\u63D2\u4EF6\u3001webpack \u4F18\u5316\u3001\u524D\u7AEF\u53D1\u5E03\u3001\u6027\u80FD\u4F18\u5316\u8FD9\u5757\u7EE7\u7EED\u6DF1\u5165\uFF0C\u8FD9\u662F\u6700\u597D\u7684\u7ED3\u679C\u3002</p><p>\u540C\u65F6\u5BF9\u4E8E\u60F3\u8F6C\u884C\u6216\u8005\u60F3\u5728\u5176\u4ED6\u9886\u57DF\u6709\u6240\u53D1\u5C55\u7684\u540C\u5B66\uFF0C\u4E5F\u662F\u63D0\u4F9B\u4E86\u4E00\u4E2A\u57FA\u672C\u7684\u95E8\u69DB\u3002</p><p>\u5F53\u7136\u60F3\u6CD5\u603B\u662F\u7F8E\u597D\u7684\uFF0C\u5728\u5F53\u521D\u8BBE\u8BA1\u7684\u65F6\u5019\u5B8C\u5168\u6CA1\u6709\u8003\u8651\u5230\u540E\u7EED\u6211\u81EA\u5DF1\u4E2A\u4EBA\u7684\u65F6\u95F4\u95EE\u9898\uFF0C\u6240\u4EE5\u5BFC\u81F4\u6574\u4E2A\u5C0F\u518C\u62D6\u66F4\u7684\u65F6\u95F4\u6BD4\u8F83\u957F\uFF0C\u6700\u7EC8\u8FD8\u662F\u6CA1\u6709\u5728 30 \u5C81\u7684\u751F\u65E5\u524D\u622A\u7A3F\uFF0C\u5728\u6B64\u4E5F\u8DDF\u5404\u4F4D\u7B49\u5F85\u7684\u540C\u5B66\u8BF4\u4E00\u58F0\u62B1\u6B49\u3002</p><h4 id="\u5185\u5BB9\u7684\u53D8\u52A8" tabindex="-1">\u5185\u5BB9\u7684\u53D8\u52A8 <a class="header-anchor" href="#\u5185\u5BB9\u7684\u53D8\u52A8" aria-hidden="true">#</a></h4><p>\u5C0F\u518C\u7684\u5185\u5BB9\u8DDF\u6700\u521D\u7684\u8BBE\u8BA1\u5BF9\u6BD4\u662F\u6709\u8FC7\u53D8\u52A8\u7684\uFF0C\u5728\u5199\u7684\u8FC7\u7A0B\u4E2D\u53D1\u73B0\u4E00\u6A21\u5757\u4E0D\u5408\u9002\uFF0C\u6211\u505A\u4E86\u5220\u51CF\uFF0C\u5F71\u54CD\u6700\u5927\u7684\u4E24\u4E2A\u6A21\u5757\u662F Kubernetes \u4E0E Gitlab CICD\u3002</p><p>Kubernetes \u662F\u505A\u4E86\u5927\u7684\u53D8\u52A8\uFF0C\u56E0\u4E3A Kubernetes \u8FD9\u4E00\u7AE0\u7684\u5185\u5BB9\u4E0E\u5723\u677E\u7684\u5C0F\u518C\u9AD8\u5EA6\u91CD\u5408\uFF0C\u540C\u65F6\u6211\u4EEC\u5C0F\u518C\u7684\u53D7\u4F17\u7FA4\u4F53\u4E5F\u9AD8\u5EA6\u91CD\u5408\uFF0C\u90A3\u4E48\u4E5F\u5C31\u610F\u5473\u7740\u5982\u679C\u540C\u65F6\u4E70\u4E24\u672C\u5C0F\u518C\u7684\u540C\u5B66\u4F1A\u770B\u5230\u7C7B\u4F3C\u7684\u5185\u5BB9\uFF0C\u8FD9\u5E76\u975E\u662F\u6211\u60F3\u8981\u7684\u7ED3\u679C\u3002</p><p>\u6211\u4E00\u76F4\u5728\u601D\u8003\u600E\u4E48\u6837\u89E3\u51B3\u8FD9\u4E2A\u95EE\u9898\uFF0C\u76F4\u5230\u6700\u8FD1\u6709\u540C\u5B66\u63D0\u5230\u4E86 Rancher\uFF0C\u7ED9\u4E86\u6211\u4E00\u4E2A\u89E3\u51B3\u65B9\u6848\uFF0C\u6240\u4EE5\u6700\u540E\u6211\u5C06 Kubernetes \u8FD9\u4E00\u7AE0\u6362\u6210\u4E86 Rancher\uFF0C\u8FD9\u662F\u4E00\u4E2A\u4EE5 Kubernetes \u4E3A\u57FA\u7840\u7684\u4F01\u4E1A\u7EA7\u5BB9\u5668\u7BA1\u7406\u5E73\u53F0\uFF0C\u5BF9\u4E8E\u4E70\u4E86\u4E24\u672C\u5C0F\u518C\u7684\u540C\u5B66\u53EF\u4EE5\u5B66\u5230\u4E0D\u540C\u7684\u77E5\u8BC6\u70B9\uFF0C\u90A3\u4E48\u5BF9\u4E8E\u65B0\u540C\u5B66\u4E00\u6837\u53EF\u4EE5\u901A\u8FC7\u5B66\u4E60 Rancher \u6765\u4E86\u89E3 Kubernetes \u6216\u8005\u5BB9\u5668\u7BA1\u7406\u7684\u76F8\u5173\u5185\u5BB9\u3002</p><p>Gitlab CICD \u6A21\u5757\u662F\u76F4\u63A5\u5220\u9664\u4E86\uFF0C\u56E0\u4E3A\u6574\u4E2A devops \u7684\u811A\u672C\u8C03\u5EA6\uFF0C\u6700\u521D\u5C31\u662F\u57FA\u4E8E Jenkins \u7684\uFF0C\u800C\u4E24\u5957 CICD \u7684\u65B9\u6848\u4E5F\u662F\u9AD8\u5EA6\u91CD\u5408\uFF0C\u4F7F\u7528 devops \u53BB\u8C03\u7528 Gitlab \u7684 api \u518D\u6765\u89E6\u53D1\u6784\u5EFA\u7684\u6A21\u5F0F\uFF0C\u5B9E\u9645\u4F7F\u7528\u4E0B\u6765\u5E76\u975E\u975E\u5E38\u53CB\u597D\uFF0C\u56E0\u4E3A\u8FD9\u662F Gitlab \u9488\u5BF9\u81EA\u8EAB\u7684\u4F53\u7CFB\u6539\u5F00\u53D1\u7684\u529F\u80FD\uFF0C\u4E0D\u592A\u65B9\u4FBF\u7B2C\u4E09\u65B9\u53BB\u96C6\u6210\uFF0C\u6240\u4EE5\u8FD9\u4E5F\u662F\u76F4\u63A5\u5220\u9664\u7684\u539F\u56E0\u3002</p><p>\u5176\u4ED6\u7684\u4E00\u4E9B\u6539\u52A8\u90FD\u662F\u5C0F\u7EC6\u8282\u4E0A\u9762\u7684\u6539\u52A8\uFF0C\u5E76\u6CA1\u6709\u5F71\u54CD\u6574\u4F53\u5927\u7EB2\uFF0C\u4E0D\u63D0\u4E5F\u7F62\u3002</p><blockquote><p>\u76EE\u524D\u8FD8\u5DEE\u4E24\u4E2A\u72EC\u7ACB\u7684\u6A21\u5757\u5728\u6293\u7D27\u5B8C\u6210\u4E2D\uFF0C\u4F46\u5DF2\u7ECF\u4E0D\u5F71\u54CD\u5B8C\u6574\u7684\u6D41\u7A0B\u4E86\uFF0C\u9274\u4E8E\u6709\u4E9B\u540C\u5B66\u6709\u5B58\u7A3F\u4E00\u8D77\u770B\u7684\u4E60\u60EF\uFF0C\u6240\u4EE5\u63D0\u9192\u5927\u5BB6\u53EF\u4EE5\u653E\u5FC3\u770B\u3002</p></blockquote><h2 id="\u8C22\u5E55" tabindex="-1">\u8C22\u5E55 <a class="header-anchor" href="#\u8C22\u5E55" aria-hidden="true">#</a></h2><p>\u6700\u540E\u611F\u8C22\u4E00\u8DEF\u4EE5\u6765\u5404\u4F4D\u540C\u5B66\u7684\u652F\u6301\uFF0C\u4E5F\u611F\u8C22\u5F88\u591A\u540C\u5B66\u60F3\u50AC\u7A3F\u4F46\u7ED9\u4E88\u5145\u5206\u7684\u7406\u89E3\uFF0C\u6700\u540E\u662F\u6398\u91D1\u65B9\u9762\u7ED9\u4E88\u7684\u652F\u6301\u4E0E\u4F53\u8C05\uFF0C\u771F\u7684\u975E\u5E38\u8C22\u8C22\u5927\u5BB6\u3002</p><p>\u5728\u8FD9\u4E00\u5E74\u4EE5\u6765\u53D1\u751F\u4E86\u5F88\u591A\u4E8B\u60C5\u3001\u8BA4\u8BC6\u4E86\u5F88\u591A\u4EBA\u4E5F\u8D70\u8FC7\u4E86\u5F88\u591A\u8DEF\uFF0C\u6700\u7EC8\u8FD9\u4E5F\u7B97\u662F\u7ED9\u81EA\u5DF1 30 \u5C81\u7684\u804C\u4E1A\u751F\u6DAF\u753B\u4E0A\u4E86\u4E00\u4E2A\u4E0D\u591F\u5706\u6EE1\u7684\u53E5\u53F7\u3002</p>',29),n=[d];function s(i,h,o,c,_,l){return p(),a("div",null,n)}const f=e(t,[["render",s]]);export{b as __pageData,f as default};
